import './topbar.css';
import { logo } from '../../dummyData';

export default function Topbar() {
  return (
    <div className='topbar'>
        <div className="topbarLogo">
            <img src={logo} alt="logo" className="topbarLogoImg" />
        </div>
        <div className="topbarItem">
            sdfds
        </div>
    </div>
  )
}
